// JavaScript Document

function carrega_documentos(tipo){
	"use strict";
	app.controler_pull("documentos");
    var pg = 0;
	if(tipo === 4){
		$("#busca_documento").val("");
	}
    if(tipo === 0 || tipo===3 || tipo===4){
        pg = 1;
    }else{
        //var offset = $("#retorno_documentos").find(".documento").size();
        var offset = $(".documento_card").length;
        if(offset !== 0){
            pg = (offset/10)+1;
        }else{
            pg = 1;
        }
		if(parseInt(pg) !== parseFloat(pg)) { 
        	pg = pg+1; 
    	}
    }
    var dados     = '';
	var dado      = '';
	var tipo_     = '';  
	var caminho   = '';
	$.ajax({
		type: 'POST',
        url        : localStorage.getItem('DOMINIO')+"appweb/documento_get.php",
        crossDomain: true,
        beforeSend : function() { },
        complete   : function() { },
        data       : { id_condominio : $( "#DADOS #ID_CONDOMINIO" ).val(), id_usuario_condominio : $( "#DADOS #ID_USER" ).val(), pg : parseInt(pg), busca_doc : $('#busca_documento').val() },
        dataType   : 'json',
		success: function(retorno){
            //alert(retorno);
			var cont = 0;
            for (x in retorno) {
				cont++;
                caminho = retorno[x]['local'].split('../');
                tipo_ = caminho[1].split('.');
				var titulo = retorno[x]['titulo']+' ('+retorno[x]['descricao']+')';
				
				titulo = limita_txt(titulo,20);
				dado = 	'<div class="card padrao_card documento_card">'+
							'<div class="card-header cabecalho_card" style="background-color: #f39c12; color:white;">'+
								'<div>'+titulo+'</div>'+
								'<div>'+retorno[x]['tipo']+'</div>'+
							'</div>'+
							'<div class="card-content card-content-padding corpo_card">'+
								'<button style="margin:0 0 0 25%; width:50%" class="col button button-fill color-green" href="#" onClick="download_arquivo( \''+localStorage.getItem('DOMINIO')+caminho[1]+'\',\''+tipo_[1]+'\',\''+retorno[x]['titulo']+'\')"><i class="fa fa-cloud-download"></i>DOWNLOAD</button>'+
							'</div>'+
						'</div>';
				
                dados = dados + dado;
            }
			if(tipo === 0){
				$( "#main_documento" ).html('');
			}
			if(cont == 0 && offset == 0){
				var sem_reg = "<div align='center' style='margin-top: 30%; width:100%'><h4>Ops! Nenhum registro encontrado aqui :(</h4><br>"
				+" <img  width='50%' src='data:image/png;base64,'></div>";
				$("#main_documento").html(sem_reg);
			}
            $( "#main_documento" ).append(dados);
			afed('#documentos','#home','','',3,'documentos');
          		
		},
        error      : function() {
            //alert('Erro ao carregar');

        }
	});	
}
